import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Search for products to get to results page with sort options
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn');
    await page.waitForLoadState('networkidle');

    // Wait for sort controls to appear
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });

    // Apply price sort filter (low to high)
    await page.selectOption('#sortSelect', 'price-low');
    await page.waitForTimeout(1000); // Wait for sort to apply

    // Take screenshot after applying sort
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_price_sort_applied.png'));

    // Extract product prices to verify sort
    const prices = await page.$$eval('.product-price', elements => 
      elements.map(el => {
        const priceText = el.textContent;
        const match = priceText.match(/\$\d+\.\d+/);
        return match ? parseFloat(match[0].replace('$', '')) : 0;
      })
    );

    // Verify prices are sorted low to high
    const isSorted = prices.every((price, i, arr) => 
      i === 0 || price >= arr[i - 1]
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) and verified product ordering",
      extractedData: {
        prices: prices.slice(0, 5), // First 5 prices
        isCorrectlySorted: isSorted
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
